{% block body %} 
\t<div class=\"uv-paper-article\">
\t\t<div class=\"uv-paper-section\">
\t\t\t<section>
\t\t\t\t<h1 class=\"uv-folder-title\" data-count=\"{{articlesCount}} {{\"Articles\"|trans}}\">{{category.name}}</h1>
\t\t\t\t<p>{{category.description}}</p>
\t\t\t</section>
\t\t\t<section class=\"uv-margin-top-30\">
\t\t\t\t<h4>{{'ARTICLES'|trans}}</h4>

\t\t\t\t{% if articles %}
\t\t\t\t\t<ul>
\t\t\t\t\t\t{% for article in articles %}
\t\t\t\t\t\t\t{#<li> {% if article.stared %}<span class=\"uv-icon-star uv-pre\"></span>{% endif %} <a href=\"{{path('helpdesk_knowledgebase_read_article', {'article': article.id})}}\">{{article.name}}</a></li>#}
\t\t\t\t\t\t\t<li> {% if article.stared %}<span class=\"uv-icon-star uv-pre\"></span>{% endif %} <a href=\"{{path('helpdesk_knowledgebase_read_slug_article', {'slug': article.slug})}}\">{{ article.name }}</a></li>
\t\t\t\t\t\t{% endfor %}
\t\t\t\t\t</ul>
\t\t\t\t{% else %}
\t\t\t\t\t<p>{{\"No Article Found!\"|trans}}</p>
\t\t\t\t{% endif %}
\t\t\t</section>
\t\t</div>
\t</div>
\t{{parent()}}
